import * as mongoose from 'mongoose';
import * as bcrypt from 'bcrypt';
const SALT_WORK_FACTOR = 10;

export interface Imember extends mongoose.Document {
  admin: boolean;
  email: string;
  password: string;
  name: string;
  birthday: string;
  phone: number;
  gender: string;
  joinDate: string;
}

const memberSchema = new mongoose.Schema({
  email: {
    type: String,
    required: true,
  },
  password: {
    type: String,
    required: true,
    min: 8,
    max: 20,
  },
  name: {
    type: String,
    required: true,
  },
  birthday: {
    type: String,
    required: true,
  },
  phone: {
    type: Number,
    required: true,
  },
  gender: {
    type: String,
    required: true,
  },
  joinDate: {
    type: String,
    required: true,
  },
  admin: {
    type: Boolean,
    required: true,
    default: false,
  },
  img: {
    type: String,
    default:
      'data:image/png;base64,',
  },
});

memberSchema.pre<Imember>('save', async function save(next) {
  if (!this.isModified('password')) return next();
  try {
    const salt = await bcrypt.genSalt(SALT_WORK_FACTOR);
    this.password = await bcrypt.hash(this.password, salt);
    return next();
  } catch (err) {
    return next(err);
  }
});

export const Member = mongoose.model<Imember>('Member', memberSchema);
